('2400','2','8351','Wohnung Brigitte',Null,'Dublex Wohnung am Paseo Maritimo mit Blick auf den Jachthafen von Palma de Mallorca','33729','Diese Dublexwohnung befindet sich direkt am Paseo Maritimo mit tollem Blick über den Jachthafen von Palma de Mallorca. Die mit Kameras überwachte und sichere Wohnanlage wurde 1986 erstellt. Die Wohnung kann mit einem Gästelift oder einem Angestelltenlift aus erreicht werde. Die ca 290m² konstruierte Fläche verteilt sich auf 2 Etagen, die mit einer Innen- und Außentreppe miteinander verbunden sind. Die obere Etage (3. Stockwerk) bietet ca 40m² Terrasse und 183m² Wohnfläche, die sich auf Eingangsdiele, Wohn-Esszimmer, 3 Schlafzimmer mit je einem Bad en suite, einer weißen hochwertigen  Einbauküche, einem Hauswirtschaftsraum und einem Abstellraum aufteilt. Die untere Etage mit ca 107m² kann als Spabereich genutzt werden. Ein Jacuzzi, eine finnische Sauna, eine Dusche und ein WC sind vorhanden. Des Weiteren hat es noch gibt es noch ein Büroraum, einen Weinschrank und eine über 100m² große Terrasse. Zur Ausstattung gehören noch eine Gaszentralheizung mit Wandradiatoren, eine Klimaanlage, Video Türöffner, und Marmor Fußböden. Im Außenbereich hat es noch einen Gemeinschaftspool mit Liegeterrassen. 1 Tiefgaragenplatz ist im Verkaufspreis enthalten','33730','1290000','106','2015-11-19 10:06:01','110','2015-11-19 10:06:47',Null,'2515','105','1180',1,'1','0',Null,Null,Null,'33731',Null,'0','0','0',Null,'2015-11-20 15:03:50',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33732',Null,'33733',Null,'33734',Null,'33735','670 690 014','33736','0',0,'0');
